@here We have expanded the "btcli" tool to allow private messages. You can open a chat with the cli by clicking on the icon and then --> send message. Here you can carry out normal operations on the cli and eventually manage your wallet etc. As a means of limiting the spam on the main channel we recommend doing this instead of making calls in the general channel. 
Thanks to @qweqweqweqwe for expanding this functionality over the weekend.  
Cheers.

You're welcome @nial0746. Thank you.

Re endorsement: 

@0xTab the foundation does not endorse projects, but the community can, and what you're going through right now is that endorsement. 

@nial0746 This is also not the first exchange that has asked for this.
